import React, { useState } from "react";
import axios from "axios";
import { Container, Form, Button, Alert } from "react-bootstrap";
import "./"; // Pastikan file ini ada dan terhubung

const TambahWisata = () => {
    const [formData, setFormData] = useState({
        nama: "",
        deskripsi_id: "",
        deskripsi_en: "",
        gambar: "",
        latitude: "",
        longitude: ""
    });

    const [message, setMessage] = useState("");

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post("http://localhost:5000/api/wisata", formData);
            setMessage({ type: "success", text: "Wisata berhasil ditambahkan!" });
            setFormData({
                nama: "",
                deskripsi_id: "",
                deskripsi_en: "",
                gambar: "",
                latitude: "",
                longitude: ""
            });
        } catch (error) {
            console.error("Error menambah wisata:", error);
            setMessage({ type: "danger", text: "Gagal menambahkan wisata." });
        }
    };

    return (
        <Container className="tambah-wisata-container">
            <h2 className="text-center my-4">Tambah Destinasi Wisata</h2>
            {message && <Alert variant={message.type}>{message.text}</Alert>}

            <Form onSubmit={handleSubmit} className="tambah-wisata-form">
                <Form.Group className="mb-3">
                    <Form.Label>Nama Wisata</Form.Label>
                    <Form.Control
                        type="text"
                        name="nama"
                        value={formData.nama}
                        onChange={handleChange}
                        required
                    />
                </Form.Group>

                <Form.Group className="mb-3">
                    <Form.Label>Deskripsi (Indonesia)</Form.Label>
                    <Form.Control
                        as="textarea"
                        name="deskripsi_id"
                        value={formData.deskripsi_id}
                        onChange={handleChange}
                        required
                        rows={3}
                    />
                </Form.Group>

                <Form.Group className="mb-3">
                    <Form.Label>Deskripsi (English)</Form.Label>
                    <Form.Control
                        as="textarea"
                        name="deskripsi_en"
                        value={formData.deskripsi_en}
                        onChange={handleChange}
                        required
                        rows={3}
                    />
                </Form.Group>

                <Form.Group className="mb-3">
                    <Form.Label>Nama File Gambar</Form.Label>
                    <Form.Control
                        type="text"
                        name="gambar"
                        value={formData.gambar}
                        onChange={handleChange}
                        placeholder="Contoh: benteng.jpg"
                        required
                    />
                </Form.Group>

                <Form.Group className="mb-3">
                    <Form.Label>Latitude</Form.Label>
                    <Form.Control
                        type="text"
                        name="latitude"
                        value={formData.latitude}
                        onChange={handleChange}
                        required
                    />
                </Form.Group>

                <Form.Group className="mb-3">
                    <Form.Label>Longitude</Form.Label>
                    <Form.Control
                        type="text"
                        name="longitude"
                        value={formData.longitude}
                        onChange={handleChange}
                        required
                    />
                </Form.Group>

                <div className="text-center">
                    <Button variant="primary" type="submit" className="btn-tambah">
                        Tambah Wisata
                    </Button>
                </div>
            </Form>
        </Container>
    );
};

export default TambahWisata;
